static void main(String[] args) {\r\n        System.out.println(\"Hello, World!\");\r\n    }\r\n}\r\n</code></pre>',NULL,'2025-03-07 09:09:12','2025-03-07 09:09:12',0),(23,7,16,1,1,'하이라이트 테스트22','시작은 이렇게 <pre><code> public class Main { public static void main(String[] args) { System.out.println(\"Hello, World!\"); } } </code></pre> \r\n\r\n\r\n\r\n---아님 이렇게 <pre><code class=\"language-java\"> public class Main { public static void main(String[] args) { System.out.println(\"Hello, World!\"); } } </code></pre>',NULL,'2025-03-07 09:22:47','2025-03-07 09:22:47',0),(24,7,16,2,3,'하이라이트','``` \r\nInteger[] array = {1, 2, 3};\r\n\r\nList<Integer> list = Arrays.asList(array);\r\n```\r\n\r\n아니면\r\n\r\n```java\r\nInteger[] array = {1, 2, 3};\r\n\r\nList<Integer> list = Arrays.asList(array);\r\n```',NULL,'2025-03-07 09:42:57','2025-03-07 09:42:57',0),(25,7,26,2,1,'브라우저 테스트22','유후\r\n\r\n<pre><code>\r\ndef to_uppercase(text):\r\n    return text.upper()\r\n\r\nuser_input = input(\"Enter a string: \")\r\nprint(\"Uppercase:\", to_uppercase(user_input))\r\n\r\n</pre></code>',NULL,'2025-03-07 13:26:52','2025-03-07 13:26:52',0),(26,7,6,1,1,'브라우저 테스트11','dd',NULL,'2025-03-09 01:58:16','2025-03-09 01:58:16',0),(27,7,18,3,4,'브라우저 테스트0909','0909\r\n0000 수정이가 수정한다\r\n\r\n<pre><code>\r\n    @GetMapping\r\n    public String index(Model model){\r\n        List<PostSummaryDto> recentPosts = postService.getRecentPosts();\r\n        List<PostSummaryDto> poplarPosts = postService.getPopularPosts();\r\n        model.addAttribute(\"recentPosts\", recentPosts);\r\n        model.addAttribute(\"popularPosts\", poplarPosts);\r\n        return \"index\";\r\n    }\r\n</pre></code>',NULL,'2025-03-11 05:46:57','2025-03-11 09:17:07',0),(28,7,19,2,1,'동적 계획 문제','컨트롤러 예시 코드\r\n\r\n---\r\n\r\n<pre><code>\r\n    @GetMapping(\"/create-form\")\r\n    public String getPostForm(Model model){\r\n        // 목록 조회는 기존과 동일한 서비스 메소드를 활용\r\n        List<CategoryResponseDto> parentCategories = categoryService.getParentCategories();\r\n        // 자식 카테고리는 선택된 부모에 따라 동적으로 변경할 수 있으므로 초기에는 빈 리스트로 처리\r\n        List<CategoryResponseDto> childCategories = new ArrayList<>();\r\n        List<PlatformResponseDto> platforms = platformService.getPlatforms();\r\n        List<LanguageResponseDto> languages = languageService.getLanguages();\r\n\r\n        // 게시글 작성을 위한 빈 DTO 추가\r\n        model.addAttribute(\"requestDto\", new PostRequestDto());\r\n        model.addAttribute(\"parentCategories\", parentCategories);\r\n        model.addAttribute(\"childCategories\", childCategories);\r\n        model.addAttribute(\"platforms\", platforms);\r\n        model.addAttribute(\"languages\", languages);\r\n\r\n        return \"posts/create-form\";\r\n    }\r\n\r\n</pre></code>\r\n코드 예시 끝',NULL,'2025-03-11 11:01:18','2025-03-11 11:01:18',0),(29,7,33,1,1,'브라우저 테스트','ㅁㅁㅁ11',NULL,'2025-03-11 11:18:01','2025-03-11 11:22:28',0),(30,7,16,3,6,'리다이렉트 테스트','111',NULL,'2025-03-12 06:09:43','2025-03-13 11:18:31',0),(31,7,14,1,3,'afaf','aaaaaabb',NULL,'2025-03-14 09:08:16','2025-03-20 10:26:34',1),(32,7,26,1,4,'ㅁㅇㅁㅇ','ㅁㅇㅁㅇㅁㅇㅁㅇㅁㅇ\r\n\r\n<pre><code> \r\n@GetMapping\r\n    public String index(Model model){\r\n        List<PostPreviewResponseDto> recentPosts = postService.getRecentPosts();\r\n        List<PostPreviewResponseDto> poplarPosts = postService.getPopularPosts();\r\n        model.addAttribute(\"recentPosts\", recentPosts);\r\n        model.addAttribute(\"popularPosts\", poplarPosts);\r\n        return \"index\";\r\n    }\r\n </code></pre>',NULL,'2025-03-15 03:40:49','2025-03-25 08:11:44',1),(33,7,10,1,1,'트리는 역시','크리스마스 트리',NULL,'2025-03-16 03:38:45','2025-03-20 11:00:44',1),(35,24,26,3,2,'ㅎㅎㅎㅎ','ㅁㄴㅇㄹㅁㄴㅇㄹ',NULL,'2025-03-20 03:37:51','2025-03-21 10:09:24',2),(36,27,14,2,2,'이야호','하핳하',NULL,'2025-03-21 10:08:32','2025-03-31 05:27:20',1),(37,7,33,2,1,'분수의 덧셈','기약분수로 변환할 줄 아는게 포인트다.\r\n\r\n<pre><code> \r\nclass Solution {\r\n    public int[] solution(int numer1, int denom1, int numer2, int denom2) {\r\n        int[] answer = new int[2];\r\n        \r\n        int numerSum = numer1*denom2 + numer2*denom1;  // 분자의 합\r\n        int denomSum = denom1 * denom2;  // 분모의 합\r\n        int max = 1;\r\n        \r\n        for(int i=1; i<=numerSum; i++){\r\n            if(numerSum%i == 0 && denomSum%i == 0){\r\n                max = i;\r\n            }\r\n        }\r\n        \r\n        answer[0] = numerSum/max;\r\n        answer[1] = denomSum/max;\r\n        \r\n        return answer;\r\n    }\r\n}\r\n </code></pre>\r\n\r\n끝.\r\n\r\n','https://school.programmers.co.kr/learn/courses/30/lessons/120808','2025-03-22 03:08:36','2025-03-23 01:38:22',1),(38,30,11,3,1,'1번 문제 ','벌써 4시네..','https://school.programmers.co.kr/learn/courses/30/lessons/120805','2025-03-26 06:53:05','2025-03-26 06:53:05',0);
